-- ----------------------------
-- Procedure structure for pro_clear_data
-- ----------------------------
DROP PROCEDURE IF EXISTS `pro_clear_data`;
delimiter ;;
CREATE PROCEDURE `pro_clear_data`()
BEGIN  
      
       SET @news_count=(SELECT COUNT(id) FROM work_accesslog);
       IF(@news_count>5000) THEN 
	    
	    SET @max_id=(SELECT MAX(id) FROM work_accesslog);
	    SET @max_id = @max_id - 5000;
            DELETE FROM `work_accesslog` WHERE id<@max_id;
            
       END IF ;
       
    END
;;
delimiter ;

-- ----------------------------
-- Function structure for tongji
-- ----------------------------
DROP FUNCTION IF EXISTS `tongji`;
delimiter ;;
CREATE FUNCTION `tongji`(roleid int)
 RETURNS int(11)
begin 
 return (select count(*) from work_myjianniang where role_id = roleid);
end
;;
delimiter ;

-- ----------------------------
-- Event structure for event_time_clear_data
-- ----------------------------
DROP EVENT IF EXISTS `event_time_clear_data`;
delimiter ;;
CREATE EVENT `event_time_clear_data`
ON SCHEDULE
EVERY '86400' SECOND STARTS '2018-08-26 12:58:43'
ON COMPLETION PRESERVE
DO CALL pro_clear_data()
;;
delimiter ;

